import React from 'react';
import {AppBar, Toolbar,CssBaseline,Typography, Link} from "@material-ui/core";
import useStyles from './stylesHeaderTry';

function HeaderTry() {

  const classes = useStyles();
  return (
      <>
        <AppBar style={{background: 'blue', width:'100%', height:'9%'}} position="fixed">
            <CssBaseline />
            <Toolbar >
                <div className={classes.navLinks}>
                    <Link className={classes.link} href="#" underline="none">
                        Home
                    </Link>
                    <Link className={classes.link} href="#" underline="none">
                        View Posts
                    </Link>
                    <Link className={classes.link} href="#" underline="none">
                        Add Post
                    </Link>
                </div>
            </Toolbar>
        </AppBar>
      </>
  );
}

export default HeaderTry;
